const home = () => {
    return (

        <><header>
            <div class="logo">

                <img src="logo.png" onclick="gotoSearch();" width="60" height="60px" />

            </div>
            <div class="menu">
                <ul>
                    <li>
                        <Link to="/Search" class="text">Поиск</Link>
